pragma solidity >=0.4.21 <0.6.0;

import "@openzeppelin/contracts/token/ERC721/ERC721Full.sol";
import "./ISpace.sol";

contract CiaoLobby is ISpace, ERC721Full {
    uint smalltalkers = 0;

    constructor() ERC721Full("Ciao Lobby", "CIAO") public {
        _mint(msg.sender, smalltalkers++);
    }

    function join() public {
        address u = msg.sender;
        require(balanceOf(u) == 0, "already joined");
        _mint(u, smalltalkers++);
    }

    function isMember(address x) public view returns (bool) {
        return balanceOf(x) == 1;
    }
}
